import React from 'react';
import { Table } from 'reactstrap';
import { string } from 'yup/lib/locale';
import "./Dictionary.scss";

const mockData = [{en: "sail", ua: "плавати",}]

const Dictionary: React.FC = () => {

  const list = mockData.map((item: any) => {

    const innerList = item.map((item: any, idx: number) => {
      return (
        <tr>
          <th scope="row">{ idx }</th>
          <td>{}</td>
          <td>Otto</td>
          <td>@mdo</td>
        </tr>
      )
    })

    return (
      <Table>
      <thead>
        <tr>
          <th>#</th>
          <th>EN</th>
          <th>Ua</th>
          <th>Your</th>
        </tr>
      </thead>
      <tbody>
        { innerList }
      </tbody>
    </Table>
    )
  });

  return (
    <div className="dictionary-page">
      <div className="col-9">
        <div className="dictionary-words">
          <div className="dictionary-words__party">
            { list }
          </div>
        </div>
      </div>
      <div className="col-3">
        <div className="dictionary-options">

        </div>
      </div>
    </div>
  )
}

export default Dictionary;
